import React, { useContext } from 'react'
import Texts from '../Texts';
import { Context } from '../Context';
import ConflictOfInterestPolicy from '../files/ConflictOfInterestPolicy.pdf'

export default function SystemsRegulations() {

  const { lang } = useContext(Context);
  const texts = Texts[lang];

  return (
    <>
      <div className='page-title'>
        <h1>{texts.systemsRegulations}</h1>
      </div>
      <div className='content' style={{paddingInline: '300px'}}>
        {texts.systemsRegulationsContent}
        <a href={systemsRegulationsPDF} className='decoration-none' download>
          <div className='download'>
            <h1>{texts.conflictPolicy}</h1>
            <h1 class="fa-sharp fa-solid fa-download"></h1>
          </div>
        </a>
      </div>
    </>
  )
}
